import React from "react";
import GitHubCalendar from "react-github-calendar";

const GitHubContributionCalendar = () => {
  return (
    <div className="p-6">
      <h2 className="text-2xl font-bold mb-4 text-center">
        GitHub Contributions - ekallwin
      </h2>
      <div className="flex justify-center">
        <GitHubCalendar
          username="ekallwin"
          blockSize={15}       // Size of each block
          blockMargin={5}      // Margin between blocks
          colorScheme="dark"   // Color scheme: 'light' or 'dark'
          showTotalCount={true} // Show total contributions
        />
      </div>
    </div>
  );
};

export default GitHubContributionCalendar;
